import { ProSidebar, Menu, MenuItem, SubMenu } from 'react-pro-sidebar';
import 'react-pro-sidebar/dist/css/styles.css';
// import {houseStroke,messagesStroke,providersStroke} from "../assets/AssetsManager"
// import "../Styles/SideMenu.scss"
import { BrowserRouter, Router, Route, Routes } from 'react-router-dom';


export const SideMenu = () => {

    return (
        <div className="">
            <ProSidebar rtl={true} style={{ padding: "0px" }}>
                <Menu iconShape="square">
                    <MenuItem>דף הבית
                        <BrowserRouter>
                            <Link to="/"></Link>
                        </BrowserRouter>
                    </MenuItem>
                    <MenuItem>שולחנות
                        <BrowserRouter>
                            <Link to="/tables"></Link>
                        </BrowserRouter>
                    </MenuItem>
                    <SubMenu title="תפריט">
                        <MenuItem>כל התפריט
                            <BrowserRouter>
                                <Link to="/menu"></Link>
                            </BrowserRouter>
                        </MenuItem>
                        <MenuItem>מנות ראשונות
                            <BrowserRouter>
                                <Link to="/menu/starters"></Link>
                            </BrowserRouter>
                        </MenuItem>
                        <MenuItem>מרקים
                            <BrowserRouter>
                                <Link to="/menu/Soups"></Link>
                            </BrowserRouter>
                        </MenuItem>
                        <MenuItem>מנה עיקרית
                            <BrowserRouter>
                                <Link to="/menu/MainCourse"></Link>
                            </BrowserRouter>
                        </MenuItem>
                        <MenuItem>קינוחים
                            <BrowserRouter>
                                <Link to="/menu/desserts"></Link>
                            </BrowserRouter>
                        </MenuItem>
                    </SubMenu>
                    <SubMenu title="לקוחות">
                        <MenuItem>כל הלקוחות
                            <BrowserRouter>
                                <Link to="/customers"></Link>
                            </BrowserRouter>
                        </MenuItem><MenuItem>ממתינים לשולחן
                            <BrowserRouter>
                                <Link to="/customers/tobeSitted"></Link>
                            </BrowserRouter>
                        </MenuItem><MenuItem>ממתינים לשרות
                            <BrowserRouter>
                                <Link to="/customers/sitting"></Link>
                            </BrowserRouter>
                        </MenuItem><MenuItem>ממתינים לתשלום
                            <BrowserRouter>
                                <Link to="/customers/awaitingBill"></Link>
                            </BrowserRouter>
                        </MenuItem>
                    </SubMenu>
                </Menu>
            </ProSidebar>;
        </div>
    );
};

export default SideMenu;


